CREATE DEFINER=`root`@`localhost` PROCEDURE `DEPRECATED-randomizeBookingDatetimes`(resetDT bit, dateRand bit, timeRand bit)
BEGIN
-- resets datetimes
if resetDT then
update booking
set datetime = concat("2023-03-30 08:00:00")
where booking_id > 0;
end if;

-- adds a random amount of days between reset datetime and now
if dateRand then
update booking
set datetime = date_add(datetime, interval datediff(current_date(), date(datetime))*rand() day)
where booking_id > 0;
end if;

-- adds a random amount of seconds up to 12 hours
if timeRand then
update booking
set datetime = date_add(datetime, interval 12*60*60*rand() second)
where booking_id > 0;
end if;
END ;;
