CREATE DEFINER=`root`@`localhost` PROCEDURE `generateData`(in weeks int, in start_dt datetime)
BEGIN
declare i int default 0;
declare current_dt datetime default start_dt;

delete from payment
where payment_id > 0;
alter table payment auto_increment = 1;

delete from booking
where booking_id > 0;
alter table booking auto_increment = 1;

while i < weeks do
	call runWeekend(normDist(.3, .1), current_dt);
    set i = i + 1;
    set current_dt = date_add(current_dt, interval 1 week);
end while;
END ;;
